  false,\n\t\"url\": null,\n\t\"notes\": \"These data are stacked multichannel marine
  seismic reflection data from sixteen lines recorded during 1982 off Wilkes Island,
  Antarctica, by the Institut Francais du Petrole. The following data types are included
  for each line: computer display images, location maps, and the digital seismic data.
  Software is provided to view the images, to plot selected portions of the data to
  the screen, and to convert the data into SEG-Y formation. The CD-ROM was produced
  in accordance with the ISO 9660 Standard. The display software runs only under DOS.
  All text files are in ASCII format.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
